// importing the React logo as placeholder image
import placeholderImage from './logo192.png'

const getAnimeByID = ( ID ) => {
  let title;
  let image;

  if (ID) {
    animeTitle = "Placeholder Title";
    animeImage = placeholderImage;
  }

  return {
    title,
    image,
    /* other attributes */
  }
}

const getAnimeByName = (name) => {
  let title;
  let image;

  if (name) {
    animeTitle = "Placeholder Title";
    animeImage = placeholderImage;
  }

  return {
    title,
    image,
    /* other attributes */
  }
}

export { getAnimeByID, getAnimeByName };
